#include <iostream>
#include <vector>

using namespace std;

class Solution {
    public:
        int longestNiceSubarray(vector<int>& nums) {
            int right = 1, left = 0, result = 1;
            bool nice = true;
            while(left < nums.size() && right < nums.size()) {
                nice = true;
                int i = left;
                while(i < right) {
                    if(!isNice(nums[i], nums[right])) {
                        nice = false; 
                        break;
                    } else i++;
                }
                if(nice) {
                    right++;
                } else {
                    left = i + 1;
                    if(left >= right) right = left + 1;
                }
                result = max(result, right-left);
            }
            return result;
        }
    
    private:
        bool isNice(int a, int b) {
            return (a & b) == 0;
        }
    };

